import React, { useState } from 'react';

const Form = () => {

    const [data, setData] = useState({name:"",age:null});
    return (
        <div>
            <input type="text" value={data.name} onChange={(event)=>setData({name : event.target.value})}/>
            
            <input type="text" value={data.age} onChange={(event)=>setData({age : event.target.value})}/>
        </div>
    );
};

export default Form;
